"""Test Namespace.update() behavior"""
ns = Namespace({'a': {'x': 1, 'y': 2}})
ns.update({'b': {'z': 3}})
assert ns == {'a': {'x': 1, 'y': 2}, 'b': {'z': 3}}
ns.update({'a': {'z': 3}})
assert ns == {'a': {'x': 1, 'y': 2, 'z': 3}, 'b': {'z': 3}}
ns.update({'a': {'x': 5}})
assert ns == {'a': {'x': 5, 'y': 2, 'z': 3}, 'b': {'z': 3}}
